{"id": "122423", "title": "Bug 122423 - Support page range in RenderTask", "description": "Bug 122423 - Support page range in RenderTask. If a page range is specified, parse it and output the pages one after another, separated by a page splitter, similar to the runAndRenderTask function. If only one page number is set, only that page should be output.", "OB": "For PDF format, if a page range is specified, log a message stating that range is not supported and still output the entire report. 

For HTML format, support page range in the format of '1,2,510' + 'All'. If an invalid page number is encountered, it should be logged, and an error message returned.", "EB": "N/A", "SR": "For PDF format, if a page range is specified, log a message stating that range is not supported and still output the entire report.  

For HTML format, support page range in the format of '1,2,510' + 'All'. If no range is set, check if a page number is set."}
